import styled from "styled-components";

import SideBar from "../components/SideBar";
import Gallery from "../components/Gallery";

const Container = styled.div`
  display: flex;
  align-items: space-between;
`;

const HomePage = () => {
  return (
    <Container>
      <SideBar />
      <Gallery />
    </Container>
  );
};

export default HomePage;
